      | 29977 -> { ItemTypeData.id= 29977; name= "OLD Loki Defensive - Warfare Processor"; published= false; description= "This subsystem is obsolete and has been replaced by newer technology    After countless failed projects over the years, the dream of linking fleets with sub-Battlecruiser hulls was eventually shelved and relegated to the realm of engineering theory. It remained this way for some time, tempting few starship manufacturers to revisit the challenge, even after the discovery of ancient Sleeper designs and the influx of fullerene-based technology. It was not until the first Strategic Cruiser hulls began appearing in small numbers across the empires that they began to truly appreciate the potential Tech III vessels had for modifications.      Not long after, the first warfare processor housing became a reality. Although what it delivered as a standalone unit was undoubtedly impressive, what would count more in time was the way it served as a catalyst. The unit demonstrated to the wider spacefaring industry that the possibilities for Tech III ships were broader than first imagined, and in doing so, it heralded the beginning of even more radical and innovative designs.     Subsystem Skill Bonus:  2% bonus to strength and duration of Skirmish Command, Shield Command, and Armored Command Bursts per subsystem skill level    Role Bonus:  Can fit one Command Burst module  +50% bonus to Command Burst Area of Effect Range"; marketGroupId= None; groupId= 955; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 1400000.000000 }; { DogmaAttributeValueData.attributeId = 263; value= 3100.000000 }; { DogmaAttributeValueData.attributeId = 2696; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 1418; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 1419; value= 0.325000 }; { DogmaAttributeValueData.attributeId = 1420; value= 0.750000 }; { DogmaAttributeValueData.attribut