      | 48213 -> { ItemTypeData.id= 48213; name= "Nyx Dos Rouvenor's Bequest SKIN"; published= true; description= "King Doule dos Rouvenor III of the Garoun Empire is considered by many Gallente to be one of the essential figures in the historical developments that led to the eventual emergence of a democratic world state on Gallente Prime. The ideals of the individualistic philosophy that Doule dos Rouvenor III championed during his 36-year rule of the Garoun Empire survived that nation's collapse over a century after his death. Those early notions of personal and political freedom flowed out of the Age of Rouvenor and informed the development of a democratic federal union on Gallente Prime that was to become an interstellar empire in the shape of the Gallente Federation.    Doule dos Rouvenor III's bequest of an individualistic philosophy emphasizing personal freedom is celebrated by a unique nanocoating that recalls the ancient heraldic colors of the House of dos Rouvenor. King Doule dos Rouvenor, Third of His Name, is specially marked on this nanocoating with the bold regnal number 'III', while banners bearing the emblem of the Gallente Federation complete this epic celebration of a Gallente hero."; marketGroupId= Some(1976); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
